- input: "TEXT\x1CC00089243\x1C.TEXT\x1C\x1CF3XA\x1CTransfers on previous itemized
    reports are from the Massachusetts Democratic Party Victory Fund; a joint fundraising
    committee with the Democratic National Committee and the Massachusetts Democratic
    Party.   The receipt from the SEIU Mass State Council for $10,000 is for the purchase
    of the MDP voter file at the usual and normal charge.  The receipt from 'Massachusetts
    Democratic Party/G&S' was an internal bank transfer and should not have been listed
    as a receipt.  It has been deleted from this amendment.  Additional employers
    and occupations are reported in this amendment.  Receipts from Democratic National
    Committee/Massachusetts Democratic Party Joint Fundraising and transfers from
    the DNC to the Massachusetts Democratic State Committee were originally mis-reported
    as from the same source on the pre-general report.  That information has been
    corrected."
